    false,nt"url": null,nt"notes": "The NOAA Office for Coastal Management
    purchased digital Vexcel Ultracam imagery and digital elevation models of the Texas
    coastline at Espiritu-Santo Bay in 2007. The Coastal Texas project area is comprised
    of approximately 458 square miles. A total of 219 multispectral orthos were created
    to cover this area. Aerial imagery was collected in panchromatic, Red, Green, Blue
    and Near Infrared which yielded a natural color and false color infrared version
    of the completed digital orthophotography. Imagery was collected at an approximate
    altitude of 21000 feet above ground level.",nt"license_title": null,nt"extras":
